import React from "react";
import { Link } from "react-router-dom";
import logo from "../assets/logo.png"; // import the logo image

export default function Nav() {
  return (
    <nav className="nav">
      {/* =========================
          Brand / Logo Section
          ========================= */}
      <div className="brand">
        <Link to="/">
          {/* Use an img tag to display the actual logo */}
          <img src={logo} alt="Chefs2Table Logo" className="logo" />
        </Link>
        <div>
          {/* Site title */}
          <h1>Chefs2Table</h1>
          {/* Tagline */}
          <small>Delicious meals, exceptional deals</small>
        </div>
      </div>

      {/* =========================
          Navigation Links Section
          ========================= */}
      <div className="links">
        {/* Main site links */}
        <Link to="/">Home</Link>
        <Link to="/chefs">Chefs</Link>
        <Link to="/about">About</Link>
        <Link to="/contact">Contact</Link>

        {/* Temporary dashboard login button */}
        <Link to="/dashboard" className="btn gold">
          Login
        </Link>
      </div>
    </nav>
  );
}
